export default function App() {
  return (
    <>
      {/* <NavBar />
      <Media/> */}
      <Routes>
        <Route path='/' component={Home} />
        <Route path='/Projects' component={Project} />
        <Route path='/Contact' component={Contact} />
        <Route path='/Update' component={Update} />
      </Routes>
    </>

  );
}
